export const getStatsById = async (statsId) => {
    let response;
    const res = await fetch(`http://localhost:7070/stats/${2}`);

    const resVal = await res.json();
    if (res.status !== 200) {
        if (resVal.message) console.log(resVal.message);
        return { error: true, stats: false };
    }
    console.log(resVal);
    return { error: false, stats: resVal };
}
